import React, { ReactElement } from "react";
import "assets/mycss/components.scss";
interface Props {
  tag: string;
}

export default function Button({ tag }: Props): ReactElement {
  return (
    <div>
      <button className="my--btn">{tag}</button>
    </div>
  );
}
